export default function Weather(props){
    // console.log(props.currentWeather.current.name)

    return(
        <div className="weather">
            <spinner />
            <h2>{props.currentWeather.location.name}</h2>
            <p>Farenheit: {props.currentWeather.current.temp_f}</p>
        </div>
    )
}
